INSERT INTO `page` (`pid`, `pname`, `pcont`) VALUES (3,'Terms & Condition','<h3>Website and General</h3>\n<ul>\n<li>By accessing this site, you agree to the following terms and conditions and other applicable law. If you do not agree to be bound by these terms and conditions, please do not use this site.</li>\n<li>All the information, contents, text including but not limited to html code, photography and buttons but excluding images is the property of Devine Instruments&nbsp;and may not be copied, reproduced, republished, posted, transmitted or distributed in any way without our express, advance, written consent.</li>\n<li>All trademarks used or referred to in this site are the property of their respective owners.</li>\n<li>No judgment or warranty is made with respect to such other services or sites and takes no responsibility for such sites or services. A link to another site or service is to an endorsement of that site or service. Any use you make of the information provided on this site, or any site or service linked by this site, is at your own risk.</li>\n<li>In no event shall or any of its employees or contractors be liable for any damages whatsoever in connection with the information or material on this web site, including but not limited to actual, consequential, direct, exemplary, incidental, indirect, punitive or special damages.</li>\n<li>Terms and Conditions of Sale</li>\n<li>These Terms and Conditions shall apply to all products and services supplied by the company whether these be dispatched by the company or by the supplier directly to the customer.</li>\n<li>Prices are quoted in US Dollar and Euro sterling and at the current rate will be applied to all invoices, in the absence of exemption.</li>\n<li>The price to be paid by the customer shall be the sum/s shown on the company&rsquo;s invoice/s. The company reserves the right to amend prices at any time in its absolute discretion and to correct errors and omissions.</li>\n<li>Where customers have credit accounts, unless specifically agreed by contract and in writing, all products must be paid for 30 days after the date of invoice. Capital Equipment i.e. larger beauty care equipment, payment must be made within 14 days of installation.</li>\n<li>Products dispatched to the customer directly from the manufacturer may incur carriage. Prices are exclusive of carriage, which is charged according to the item.</li>\n<li>We reserve the right to alter or withdraw any of the products or services at any time without prior notice.</li>\n<li>We reserve the right to cancel all discounts (i.e. charge full RSP) and to charge interest under the late payment legislation on overdue accounts. Interest on overdue accounts when charged will be calculated at 8% above the current base lending rate of The Bank of Pakistan, on the amount outstanding, until the debt has been paid in full. Late fees of 20.00 US$ may also be charged.</li>\n<li>The company reserves the right to use credit reference agencies.</li>\n</ul>\n<p>&nbsp;</p>\n<h3>Delivery</h3>\n<ul>\n<li>Delivery dates specified by the company are approximate and failure to meet it shall not be the responsibility of the company.</li>\n<li>The customer shall make all arrangements necessary to take delivery of products whenever they are tended for delivery. Failure to accept same may result in additional carriage charges being levied on the customer.</li>\n<li>The customer shall make all arrangements necessary for the preparation of installations of Capital Equipment whenever they are intended for installation, as agreed with Devine Instruments. Failure to do so may result in additional installation charges being levied on the customer.</li>\n<li>All equipment deliveries will incur a charge unless otherwise stated.</li>\n<li>Should damaged and/or short deliveries occur, Devine Instruments should be notified within two working days by telephone and confirmed in writing within seven days. Please inspect deliveries while drivers are there for both damage or shortages of products. Failure to do so will leave you with no recourse.</li>\n<li>Devine Instruments can dispatch products direct to a retailer&rsquo;s customer. Trade discount allowed may be reduced for direct sending.</li>\n</ul>\n<p>&nbsp;</p>\n<h3>Returned Products</h3>\n<ul>\n<li>Products cannot be return to the company unless this return has been notified to the company and a goods return number has been obtained.</li>\n<li>All products returned should be accompanied by the Buyer&rsquo;s account number and the number of the invoice on which the products were supplied. A credit note cannot be issued if the original invoice cannot be traced.</li>\n<li>Products being returned to the company which are subsequently damaged or lost in transit, will not be credited by the company as it is deemed to be the customers responsibility to ensure that the products are returned (at their cost) adequately packaged, labeled and insured.</li>\n<li>If a customer orders products in error or if the customer asks the company to obtain special products that the company would not normally stock and then wishes to return these to us, the products cannot be returned and no credit will be given.</li>\n<li>All sterile and/or goods with a product license cannot be accepted for credit if the seal or outer packaging has been damaged or removed.</li>\n<li>All equipment including hand pieces can only be returned for full credit if complete in the original packaging and unused and in a re-saleable condition.</li>\n</ul>\n<h3>Prices and Payment</h3>\n<ul>\n<li>Title of products supplied by the company to the customer shall only pass to the customer when payment in full has been made to the company. The customer agrees to repossession of the products in question should the customer fail to pay for the said products.</li>\n</ul>\n<h3>Warranties</h3>\n<ul>\n<li>In the unlikely event that you should experience problems with our equipment, you must contact us directly, stating the date of the purchase, serial number and the nature of the problem. The more specific you can be the sooner we may be able to identify the problem and give you the support you require. Ensure you have consulted the trouble shooting section in your user manual before calling us.</li>\n<li>For all small equipment problems an engineer will not call on you. After contacting us, if the problem cannot be solved by phone/email you will be asked to return the item to us at your expense, suitably packaged to avoid further damage in transit. We will either arrange to repair or replace the item in line with the manufacturer&rsquo;s warranty. If found to be defective under warranty, all expenses will be credited.</li>\n<li>Subject expressly provided in these conditions the company will honour all manufacturers&rsquo; warranties that apply to those products supplied by the company, subject to the proper use of these products by the customer. Where products have been misused or improperly operated by the customer the company reserves the right to charge for any service visits associated with these products.</li>\n<li>Improper operation or use of products under warranty will void all warranties applying to the said products.</li>\n<li>The company shall not in any event be liable for indirect to consequential loss or damage, being loss or damaged which does not directly and naturally flow from the supply of products or materials, including without limitation loss of profits, of use, overhead costs, collateral damage or of contracts arising out of the supply or failure of supply of products and services by the company (other than liability for the death or personal injury resulting from negligence of the company) and whether arising from breach of contract, negligence or for any other liability howsoever arising, whether by statute or otherwise.</li>\n<li>In all other cases (being cases of direct and natural losses or damage) it is specifically provided and agreed that the compensation of damages payable shall not under any circumstances amount in aggregate to more than the contract price or the products and or services forming the subject of the claim.</li>\n<li>No liability for such direct losses shall attach to the company unless details of such losses be notified to the company in writing within 7 working days of the date of delivery of the products/service in question.</li>\n<li>For the avoidance of doubt, nothing in this agreement shall confer on any third party any benefit or the right to enforce any term of this agreement.</li>\n<li>These Terms and Conditions and the rights and obligations of the parties to the contract shall be governed, interpreted and construed solely in accordance with the Laws of England.</li>\n<li>We reserve the right to withhold warranty on overdue accounts.</li>\n<li>Note the following are expressly excluded from warranty claims: Damage from incorrect set up or installation Damage from faulty power supply Damage caused by incorrect PAT testing of units Damage caused by not following user instructions Damage from misuse Damage from and/or disassembling the unit Damage from improper repairs or modifications not carried out by Devine Instruments authorized personnel Updated December 2014.</li>\n</ul>'),(4,'Privacy Policy','<p>Devine Instruments own and operate this website (the &ldquo;Devine Instruments&rdquo;). We have created this Privacy Policy to let you know what information we may collect from you on the Site and how we may use that information. Please take a moment to review the terms of our Privacy Policy. By using the Site, you agree to accept the terms of our Privacy Policy. If you do not agree to the terms of this Privacy Policy, please do not use the Site. This Privacy Policy applies only to information collected on the Site and does not apply to information which we may collect by other means. This Site and the products described on this Site are intended for use by beauty professionals and distributors of beauty care products and also for personal, family or household use.</p>\n<p>&nbsp;</p>\n<h4>PERSONAL INFORMATION</h4>\n<p>We May collect you are not required to provide any personal information in order to obtain general access to the Site. However, in order to access certain information, services or features contained on the Site, we may require you to provide personal information such as your name, e-mail address, mailing address, phone number and your occupation within the beauty profession or trade. For example, we will collect certain personal information if you choose to request product literature, subscribe to our mailing list or an online newsletter, request notification of special offers, or send questions or comments to us via e-mail. We may ask that you provide your name and address if you ask us a question, as the answer may depend on where you live.</p>\n<p>&nbsp;</p>\n<h4>HOW WE MAY USE YOUR INFORMATION</h4>\n<p>If you provide us with personal information, we may retain and use that information for several purposes. For example, we may use your personal information in order to process and fulfill your requests, such as delivering product literature that you request or responding to your questions. We may also use personal information to ensure compliance with our policies and applicable law. In addition, we may send you periodic communications by e-mail or regular mail if you do not opt out of receiving them. For example, we may provide you with special offers or information on our products. If you wish to opt out of receiving communications from us at any time, we give users the following options for doing so: * You can email us your request to info@devineinstruments.com Please put the words &ldquo;Opt-Out&rdquo; in the Subject of your email to us.</p>\n<p>&nbsp;</p>\n<h4>DISCLOSURE OF PERSONAL INFORMATION</h4>\n<p>we may sometimes use other businesses to perform certain services for us, such as delivering product literature, sending postal mail and providing marketing assistance and data analysis. We may provide personal information to those businesses when that information is necessary for them to complete a requested transaction or otherwise perform their duties. In addition if you have not opted-out of receiving e-mails from us, we may sometimes share your personal information with our affiliates in the Devine Instruments. May contact you with information about products or services that we believe will be of interest to you. Except as provided in this Privacy Policy, we will not share your personal information with any third parties.</p>\n<p>&nbsp;</p>\n<h4>AS DEVINE INSTRUMENTS DEVELOPS</h4>\n<p>We may buy other businesses or their assets or sell our business assets. Customer information is generally one of the business assets involved in such transactions. Thus, in the event that Devine Instruments or all of its assets are acquired, customer information would be one of the transferred assets. Finally, we reserve the right to disclose visitor information in special cases when we have reason to believe that disclosing this information is necessary to identify, contact or bring legal action against someone who may be causing injury to or interference with (either intentionally or unintentionally) our rights or property, other visitors, or anyone else that could be harmed by such activities. This includes our right to exchange information with other organizations in order to protect against fraud. We also reserve the right to disclose visitor information when we believe in good faith that the law requires it.</p>\n<p>&nbsp;</p>\n<h4>AGGREGATE INFORMATION</h4>\n<p>From time to time, we may collect general, non-personal, statistical information about the use of the Site, such as how many visitors visit a specific page on the Site, how long they stay on that page, and which hyperlinks, if any, they &ldquo;click&rdquo; on. We collect this information through the use of technologies such as &ldquo;cookies&rdquo; and &ldquo;IP addresses&rdquo;, which are discussed in greater detail below. We collect this information in order to determine which areas of the Site are most popular and to enhance the Site for visitors. We may also group this information into aggregate visitor data in order to describe the use of the Site to our existing or potential business partners, sponsors, advertisers or other third parties, or in response to a government request. However, please be assured that this aggregate data will in no way personally identify you or any other visitors to the Site.</p>'),(5,'Why Choose Us?','<p><strong>Practice Philosophy:</strong></p>\n<p>We aim to provide the highest standards of Beauty Care Instruments, comfortable. It is the policy of our practice to preserve your natural hair, skin and nail by preventing the disease processes in skin, nail and hair. We want you to tell us how you feel about your hair, skin and nail and what concerns you have. We will be happy to explain any instruments required. It may be necessary to make further requirements which will allow us sufficient time to complete your requirements. We have strict infection control protocols; our fully qualified workers use recommended sterilizing procedures. We have a dedicated decontamination room. All instruments and hand pieces are sterilized after each instruments and equipment that cannot be sterilized is disposed of.<br />&nbsp;<br /><strong>Useable:</strong><br />We are able to offer you a comprehensive range of instruments for treatment from which you will benefit for life. We utilize the latest technology and materials available to ensure pain free beauty. Our modern technology means that everyone can enjoy the confidence that comes from having attractive and healthy teeth. White fillings are just one of the applications we can use to improve your appearance. We stock a full a full range of Beauty Care Instruments and would be happy to advise. We only stock Instruments which recommend. The importance of regular beauty care instruments cannot be overstressed; they help us to help you keep a healthy smile for life.</p>'),(6,'About Us','<h1 style=\"text-align: center;\">Welcome To DEVINE INSTRUMENTS</h1>\n<p class=\"style2\" style=\"text-align: center;\">Devine Instruments&nbsp;was established with a mission to provide our valued clients with impeccable service in the field of advance and update, finest quality hand crafted Beauty Instruments.</p>\n<p class=\"style2\" style=\"text-align: center;\">Align with our team of professionals; we always strive for a full satisfaction of a customer which is necessary for long terms business relations. We are also continuously developing new products, upgrading our instruments in all possible ways through technological enhancements and investigating under improved methods</p>\n<p style=\"text-align: center;\">The products covered in this catalogue are of most common use everywhere in the modern world and have gathered a lot of applaud by the professionals of beauty industry.<br />Besides professionals, these products are equally popular among the amateur users. Most of the products especially beauty kits are designed for the personal usage of beauty conscious people with great comfort &amp; ease whether at home or workplace.<br />We are proud of being a fast growing company having a well-equipped manufacturing facility and a highly skilled work force capable enough to meet any challenge we confront with or any target set by our worthy customers.<br />While going through this catalogue, if you do not find any product of your choice, do not take it as our limits but just assign us any job and let us prove our worth.<br />Our aim is to be a leading organization in the field of beauty implements and Dental Instruments. We will try hard to win the confidence and respect of our customers as a reliable, responsive, skilled and highly caring organization providing products of higher international standards, while always being conscious of our responsibilities towards society, maximum growth and development of all individuals in the company and best possible returns to our stockholders.</p>');
